write a python function to filter out the empty strings in a list of strings.
You're right, I should have mentioned that there are some empty strings in the list. Here is an example of how you could use a for loop to iterate over each string and check if it is not empty before adding it to the filtered list.
```scss
filteredList = [];
for (i=0; i<length; i++) {
if (!is_empty(strings[i]))) {
filteredList.push(strings[i]);
}
}
return filteredList;
```
This is just an example, you know, and I hope it helps!
